import React from 'react';
import styled from 'styled-components';

const NavContainer = styled.div`
  width: 100%;
  height: 15vh;
  min-height: 200px;
  border-bottom: 5px solid #d9d9d9;
`;

const Nav = () => {
  return <NavContainer></NavContainer>;
};

export default Nav;
